import '../App.css';
const Lista = () => {

    const estilos = {
        Boton: "bg-black flex: "
    }
    return ( 
        <main>
            <div></div>
            <div>
                <button className={estilos.Boton}>List</button>
                <button className={estilos.Boton}>Detailed View</button>
                <button className={estilos.Boton}>Search</button>
            </div>
        </main>
    );
}

export default Lista;
